const formatNFTsToSolidity = (offsets) => {
  return offsets.reduce(
    (accumulator, curr) => {
      const solidityTokenId = AccountId.fromString(
        curr.nft.token_id
      ).toSolidityAddress();
      const newTokenIds = [...accumulator.tokenIds, solidityTokenId];
      const newSerialIds = [...accumulator.serialIds, curr.nft.serial_number];
      const newPrice = [...accumulator.prices, 1];
      return {
        tokenIds: newTokenIds,
        serialIds: newSerialIds,
        prices: newPrice
      };
    },
    { tokenIds: [], serialIds: [], prices: [] }
  );
};
